DROP TABLE IF EXISTS `ip`;
CREATE TABLE `ip` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '代理主键',
  `ip_address` varchar(18) DEFAULT NULL COMMENT '代理IP地址',
  `ip_port` varchar(6) DEFAULT NULL COMMENT '代理IP端口',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '该IP地址被插入数据库里面的时间',
  `type_name` varchar(10) DEFAULT 'HTTP' COMMENT '代理的类型，默认为HTTP代理',
  `anonymity` varchar(20) DEFAULT '透明代理' COMMENT 'IP的代理透明度，透明、低匿名，高匿名',
  `location` varchar(50) DEFAULT NULL COMMENT '代理服务器的位置',
  `enable` tinyint(4) DEFAULT '0' COMMENT '该ip地址是否还可用，0：不可用，1：可用',
  `used_success` bigint(20) DEFAULT '0' COMMENT '该代理IP地址被成功使用过的次数，可以用来评价该代理IP地址的稳定性',
  `response_speed` varchar(10) DEFAULT '100' COMMENT '校验时该IP的响应速度，单位为秒，供参考IP性能',
  `check_times` int(11) DEFAULT '0' COMMENT '该代理IP地址被校验的次数',
  `last_check_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '上一次校验的时间，用于对IP地址的校验',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=239 DEFAULT CHARSET=utf8 COMMENT='存储ip地址的数据表';

